import React from "react";

const PokemonList = () => {
    return (
        <div>
            <h1>Its a LIST OF POKEMONS</h1>
            <div class="row">
                <div class="col">
                    1 of 3
                </div>
                <div class="col">
                    2 of 3
                </div>
                <div class="col">
                    3 of 3
                </div>
            </div>
        </div>
    )
}

export default PokemonList;
